import React,{Component } from "react";
import './SignUp.css';
import axios from 'axios';
import logo from '../images/logo.png';
import container666 from '../images/hello.png';
import { Button } from '../components/Button.js';

export class SignUp extends Component {
  constructor(props) {
  super(props)
  this.state = {
  StateId: '',
  CountryId: '',
  CountryData: [],
  StateData: [],
  CityData: []
  }
  }
  componentDidMount() {
  axios.get('http://localhost:3000/countries-list').then(response => {
  console.log(response.data);
  this.setState({
  CountryData: response.data
  });
  });
  }
  ChangeteState = (e) => {
  this.setState({
  CountryId: e.target.value
  });
  axios.get('http://localhost:3000/get-states-by-country?CountryId=' + e.target.value).then(response => {
  console.log(response.data);
  this.setState({
  StateData: response.data,
  });
  });
  }
  ChangeCity = (e) => {
  this.setState({
  StateId: e.target.value
  });
  axios.get('http://localhost:65173/get-cities-by-state?StateId=' + e.target.value).then(response => {
  console.log(response.data);
  this.setState({
  CityData: response.data
  });
  });
  }
  render() {  
  return (
    <form>
      <div className="sign-up-container">
        <div className="sign-up-sign-up">
          <div className="sign-up-frame416">
            <img
              src={logo}
              alt="logo"
              className="sign-up-logo"
            />
            <div className="sign-up-logo1"></div>
            <span className="sign-up-text">
              <span>TravelCompanion</span>
            </span>
          </div>
          <div className="sign-up-frame451">
            <span className="sign-up-text02 h4">
              <h1>Sign Up</h1>
            </span>
            <div className='signupbutton'>
              <Button className='subtn' buttonStyle='btn--outline' buttonSize='btn--large'>
                Submit
              </Button>
            </div>
            <div className="sign-up-frame453">
              <div className="sign-up-frame452">
                <span className="sign-up-text06 body1Bold">
                  <span className="sign-up-text07">First Name *</span>
                  <label htmlFor='username'></label>
                  <input type='text' className='box' placeholder='Enter first name' />
                </span>
                { }
              </div>
              <div className="sign-up-frame456">
                <span className="sign-up-text10 body1Bold">
                  <span className="sign-up-text11">Last Name *</span>
                  <label htmlFor='username'></label>
                  <input type='text' className='box' placeholder='Enter last name' />
                </span>
                { }
                { }
              </div>
              <div className="sign-up-frame4531">
                <span className="sign-up-text14 body1Bold">
                  <span className="sign-up-text15">D.O.B. *</span>
                  <label htmlFor='username'></label>
                  <input type='date' className='box' placeholder='Enter date of birth' />
                </span>
                { }
              </div>
              <div className="sign-up-frame4511">
                <span className="sign-up-text18 body1Bold">
                  <span className="sign-up-text19">Contact No. *</span>
                  <label htmlFor='username'></label>
                  <input type='tel' className='box' placeholder=' +91-9136229854' pattern="+[0-9]{2-5}-[0-9]{10-12}" required />
                </span>
                { }
              </div>
              <div className="sign-up-frame454">
                <span className="sign-up-text22 body1Bold">
                  <span className="sign-up-text23">Email *</span>
                  <label htmlFor='username'></label>
                  <input type='email' className='box' placeholder='Enter email' />
                </span>
                { }
              </div>
              <div className="sign-up-frame455">
                <span className="sign-up-text26 body1Bold">
                  <span className="sign-up-text27">Country *</span>
                  <select className="form-control" name="country" value={this.state.CountryId} onChange={this.ChangeteState}  >  
                  <option>Select Country</option>  
                  {this.state.CountryData.map((e, key) => {  
                  return <option key={key} value={e.CountryId}>{e.CountryName}</option>;  
                  })}  
                  </select> 
                </span>
              </div>
              <div className="sign-up-frame457">
                <span className="sign-up-text30 body1Bold">
                  <span className="sign-up-text31">State/Province *</span>
                  <select className="form-control slct" name="state" value={this.state.StateId} onChange={this.ChangeCity} >  
                  <label for="company">State Name</label>    
                  {this.state.StateData.map((e, key) => {  
                  return <option key={key} value={e.StateId}>{e.StateName}</option>;  
                  })}  
                  </select>   
                </span>
              </div>
              <div className="sign-up-frame458">
                <span className="sign-up-text34 body1Bold">
                  <span className="sign-up-text35">City *</span>
                  <select className="form-control slct" name="city" value={this.state.CityData}  >  
                  {this.state.CityData.map((e, key) => {  
                  return <option key={key} value={e.CityId}>{e.cityName}</option>;  
                  })}  
                  </select>
                </span>
              </div>

              <div className="sign-up-frame459">
                <span className="sign-up-text38 body1Bold">
                  <span className="sign-up-text39">Username *</span>
